import React, { Component } from "react";
import {
    Route,
    NavLink,
    HashRouter
  } from "react-router-dom";
import allDonor from "./allDonor";
import CreateDonor from "./CreateDonor";
import UpdateDonor from "./UpdateDonor";
  
class Donor extends Component{
    render() {
        return (
            
                <HashRouter>
                <div className="header">
                <h2>Here you can perform all crud operations</h2>
                <br></br>
                <div className="header">
                <button><NavLink exact to="/allstock">Show Blood Stock</NavLink></button>
                <button><NavLink to ="/updateStock">Update Stock</NavLink></button>
                <button><NavLink to ="/createdonor">Create Donor Stock</NavLink></button>
                <div>
                <Route exact path="/allstock" component={UpdateDonor}/>
                <Route path="/updateStock" component={allDonor}/>
                <Route path="/createdonor" component={CreateDonor}/>
              
                </div>
                </div>
                </div>
                </HashRouter>
        );
    }
}
export default Donor
